function HomeMain(){
    const user = JSON.parse(sessionStorage.getItem("user"));
    return(
        <div id="homeMain">
            
            {user ? 
            (<div><h3>welcome to cook.ie!</h3></div>) : 
            ""}
        </div>
    );
}

export default HomeMain;
